	inline int getresult() {
		int result = value[valuesort[dfs[0]]] + value[valuesort[avaluesort[dfs[1]]]] + value[valuesort[avaluesort[dfs[2]]]];
		if (avaluesort[dfs[3]] != avaluesort[dfs[1]] && avaluesort[dfs[3]] != avaluesort[dfs[2]]) {
			result += value[valuesort[avaluesort[dfs[3]]]];
		}
		if (avaluesort[dfs[4]] != avaluesort[dfs[1]] && avaluesort[dfs[4]] != avaluesort[dfs[2]]) {
			result += value[valuesort[avaluesort[dfs[4]]]];
		}
		return result;
	}
	inline int getresult3() {
		int result = value[valuesort[dfs[0]]] + value[valuesort[avaluesort[dfs[1]]]] + value[valuesort[avaluesort[dfs[2]]]];
		return result;
	}
